script: |
  super -f text -I q4910.spq | sort > q4910.out

inputs:
  - name: q4910.spq
    data: |
      SELECT ALL + 87 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( 18 * - + col1 - - + col2 ) IN ( 16 * + + 38 / - col1 );
  - name: tab0

outputs:
  - name: q4910.out
    data: |
      87
      87
      87
